import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [darkMode, setDarkMode] = useState(
    localStorage.getItem("darkMode") === "true"
  );

  useEffect(() => {
    if (darkMode) {
      document.documentElement.classList.add("dark");
    } else {
      document.documentElement.classList.remove("dark");
    }
    localStorage.setItem("darkMode", darkMode);
  }, [darkMode]);

  return (
    <nav className="bg-white dark:bg-gray-900 shadow-md fixed top-0 left-0 w-full z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center py-4">
          {/* Logo */}
          <Link to="/" className="text-2xl font-bold text-yellow-600 dark:text-yellow-400">
            Astrology Hub
          </Link>

          {/* Search Bar */}
          <input
            type="text"
            placeholder="Search..."
            className="hidden md:block px-4 py-2 rounded-full border border-gray-300 dark:border-gray-700 focus:outline-none focus:ring-2 focus:ring-yellow-500 transition"
          />

          {/* Desktop Menu */}
          <ul className="hidden md:flex space-x-6 text-gray-700 dark:text-white font-medium">
            <li><Link to="/" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition">Home</Link></li>
            <li><Link to="/horoscope" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition">Horoscope</Link></li>
            <li><Link to="/consult" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition">Consult</Link></li>
            <li><Link to="/tarot-card" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition">Tarot Card</Link></li>
            <li><Link to="/e-pooja" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition">E-Pooja</Link></li>
            <li><Link to="/gem-store" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition">Gem Store</Link></li>
          </ul>

          {/* Dark Mode Toggle */}
          <button
            onClick={() => setDarkMode(!darkMode)}
            className="mx-4 text-gray-700 dark:text-white text-lg"
          >
            {darkMode ? "ðŸŒž" : "ðŸŒ™"}
          </button>

          {/* Login Button */}
          <button className="bg-yellow-500 text-white px-4 py-2 rounded-full shadow-md hover:bg-yellow-600 transition">
            Login
          </button>

          {/* Mobile Menu Button */}
          <button onClick={() => setIsOpen(!isOpen)} className="md:hidden text-gray-700 dark:text-white focus:outline-none">
            {isOpen ? "âœ–" : "â˜°"}
          </button>
        </div>

        {/* Mobile Menu */}
        {isOpen && (
          <ul className="md:hidden flex flex-col items-center bg-white dark:bg-gray-900 shadow-md py-4 space-y-4">
            <li><Link to="/" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition" onClick={() => setIsOpen(false)}>Home</Link></li>
            <li><Link to="/horoscope" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition" onClick={() => setIsOpen(false)}>Horoscope</Link></li>
            <li><Link to="/consult" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition" onClick={() => setIsOpen(false)}>Consult</Link></li>
            <li><Link to="/tarot-card" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition" onClick={() => setIsOpen(false)}>Tarot Card</Link></li>
            <li><Link to="/e-pooja" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition" onClick={() => setIsOpen(false)}>E-Pooja</Link></li>
            <li><Link to="/gem-store" className="hover:text-yellow-600 dark:hover:text-yellow-400 transition" onClick={() => setIsOpen(false)}>Gem Store</Link></li>
          </ul>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
